      id: 1,
      email: 'demo@deepsignal.com',
      name: 'Îç∞Î™® ÏÇ¨Ïö©Ïûê'
    };
    onLogin(demoUser);
  };

  return (
    <div className="login-container" style={{
      minHeight: '100vh',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      background: 'linear-gradient(135deg, #0f0f23 0%, #1a1a2e 50%, #16213e 100%)'
