      <div className="card" style={{
        width: '100%',
        maxWidth: '400px',
        margin: '2rem',
        padding: '2rem'
      }}>
        <div style={{ textAlign: 'center', marginBottom: '2rem' }}>
          <h1 style={{ color: '#00d4ff', marginBottom: '0.5rem' }}>
            ü§ñ DeepSignal AI
          </h1>
          <p style={{ opacity: 0.7 }}>AI Í∏∞Î∞ò ÏïîÌò∏ÌôîÌèê ÏûêÎèôÎß§Îß§ ÌîåÎû´Ìèº</p>
        </div>

        <form onSubmit={handleSubmit}>
          {!isLogin && (
            <div>
              <label>Ïù¥Î¶Ñ</label>
              <input
                type="text"
                value={formData.name}
                onChange={(e) => setFormData(prev => ({ ...prev, name: e.target.value }))}
                placeholder="Ïù¥Î¶ÑÏùÑ ÏûÖÎ†•ÌïòÏÑ∏Ïöî"
                required={!isLogin}
              />
            </div>
          )}

          <div>
            <label>Ïù¥Î©îÏùº</label>
            <input
              type="email"
              value={formData.email}
              onChange={(e) => setFormData(prev => ({ ...prev, email: e.target.value }))}
              placeholder="Ïù¥Î©îÏùºÏùÑ ÏûÖÎ†•ÌïòÏÑ∏Ïöî"
              required
            />
          </div>

          <div>
            <label>ÎπÑÎ∞ÄÎ≤àÌò∏</label>
            <input
              type="password"
              value={formData.password}
              onChange={(e) => setFormData(prev => ({ ...prev, password: e.target.value }))}
              placeholder="ÎπÑÎ∞ÄÎ≤àÌò∏Î•º ÏûÖÎ†•ÌïòÏÑ∏Ïöî"
              required
            />
          </div>

          {error && (
            <div className="error" style={{ marginBottom: '1rem' }}>
              ‚ùå {error}
            </div>
          )}

          <button 
            type="submit" 
            disabled={loading}
            style={{ width: '100%', marginBottom: '1rem' }}
          >
            {loading ? '‚è≥ Ï≤òÎ¶¨Ï§ë...' : (isLogin ? 'üîê Î°úÍ∑∏Ïù∏' : 'üìù ÌöåÏõêÍ∞ÄÏûÖ')}
          </button>
        </form>

        <div style={{ textAlign: 'center', marginBottom: '1rem' }}>
          <button 
            type="button" 
            onClick={() => setIsLogin(!isLogin)}
            style={{ background: 'transparent', border: '1px solid rgba(255,255,255,0.3)' }}
          >
            {isLogin ? 'üìù Í≥ÑÏ†ïÏù¥ ÏóÜÏúºÏã†Í∞ÄÏöî? ÌöåÏõêÍ∞ÄÏûÖ' : 'üîê Ïù¥ÎØ∏ Í≥ÑÏ†ïÏù¥ ÏûàÏúºÏã†Í∞ÄÏöî? Î°úÍ∑∏Ïù∏'}
          </button>
        </div>

        <div style={{ textAlign: 'center' }}>
          <button 
            type="button" 
            onClick={handleDemoLogin}
            className="success"
            style={{ width: '100%' }}
          >
            üöÄ Îç∞Î™® Î°úÍ∑∏Ïù∏ (ÌÖåÏä§Ìä∏Ïö©)
          </button>
          <small style={{ display: 'block', marginTop: '0.5rem', opacity: 0.7 }}>
            Îç∞Î™® Î™®ÎìúÏóêÏÑúÎäî Ïã§Ï†ú Í±∞ÎûòÍ∞Ä Î∞úÏÉùÌïòÏßÄ ÏïäÏäµÎãàÎã§
          </small>
        </div>

        <div style={{ marginTop: '2rem', padding: '1rem', background: 'rgba(0, 212, 255, 0.1)', borderRadius: '8px' }}>
          <h4 style={{ color: '#00d4ff', marginBottom: '0.5rem' }}>üí° ÌÖåÏä§Ìä∏ Í≥ÑÏ†ï</h4>
          <div style={{ fontSize: '0.9rem', opacity: 0.8 }}>
            <div>Ïù¥Î©îÏùº: admin@deepsignal.com</div>
            <div>ÎπÑÎ∞ÄÎ≤àÌò∏: password123</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
